use tokio::runtime::Runtime; fn get() -> anyhow::Result<String> { let rt = Runtime::new().unwrap(); rt.block_on(async { let url = "https://link/to/file/download"; let data = reqwest::get(url).await?.text().await?; Ok(data) })
} It has the following dependencies: [dependencies]
futures = "0.3"
reqwest = "0.11.6"
tokio = { version = "1.14.0", features = ["rt-multi-thread"] }
anyhow = { version = "1.0.49" }

