If you are using the plain futures crate without runtimes like Tokio, you should be safe to wrap the asynchronous code in an async block and use the futures::executor::block_on to run the future to completion: use futures::executor::block_on; async fn hello_world() -> String { "hello, world!".to_string()
} fn get() -> String { block_on(async { hello_world().await })
} fn main() { println!("{}", get()); // prints "hello, world!"
}

