Lastly, you can avoid async code all together by using synchronously/blocking version of the functions if they are available. In Reqwest, there's a module called reqwest::blocking designed specifically for this purpose. So you can achieve the same thing above without using async. use anyhow;
use reqwest; fn get() -> anyhow::Result<String> { let url = "https://link/to/file/download"; let data = reqwest::blocking::get(url)?.text()?; Ok(data)
} It has the following dependencies: [dependencies]
futures = "0.3"
reqwest = { version = "0.11.6", features = ["blocking"] }
anyhow = { version = "1.0.49" }

