].each { def taskPostfix = it.first def profileMode = it.second tasks.whenTaskAdded { task -> if (task.name == "javaPreCompile$taskPostfix") { task.dependsOn "cargoBuild$taskPostfix" } } tasks.register("cargoBuild$taskPostfix", Exec) { // Until https://github.com/bbqsrc/cargo-ndk/pull/13 is merged, // this workaround is necessary. commandLine 'sh', '-c', """cd ../../$crate && \ ANDROID_NDK_HOME="$ANDROID_NDK" cargo ndk \ -t armeabi-v7a -t arm64-v8a \ -o ../android/app/src/main/jniLibs build $profileMode""" }
} Note the ANDROID_NDK variable, this is a Gradle property that points to your installation of the Android NDK. If you don't rely on portability, you can hardcode this value, but note that it can be supplied by one of the many gradle.properties scattered throughout your filesystem. The most reliable way is to create a file at ~/.gradle/gradle.properties and fill it with this: ANDROID_NDK=(path to NDK)
